La risorsa è il responsabile dell'installazione, configurazione e manutenzione dei sistemi informatici

   Attività:
   * Gestione dell'infrastruttura informatica, dei sistemi operativi e delle reti aziendali;
   * Installazione e configurazione di hardware e software;
   * Monitoraggio e analisi performance del sistema informatico e delle reti dati;
   * Manutenzione ordinaria dei sistemi (aggiornamenti, installazione di sistemi di backup);
   * Risoluzione di problemi/guasti tecnici;
   * Supporto e assistenza allo staff per problematiche hardware e software.

Software house che sviluppa software e applicazioni web finalizzate ad agevolare privati e aziende nei settori della comunicazione, marketing e gestione d'impresa
   Principali responsabilità
     * Realizzazione moduli custom per Drupal;
     * Integrare sistemi tramite webservices;
     * Realizzare API;
     * Scrivere documentazione e tests (PHP e/o Cypress);
     * Implementare soluzioni multipiattaforma e cross-browser.

raccolta specifiche ed analisi progettuale;

   .Installare il software;

   .fornire consulenza applicativa ed operativa finalizzata al progetto;

   .assistere il cliente, da remoto oppure on site, anche telefonicamente e via ticket.

Innovativa Software House altamente specializzata in ambito IoT
   Principali responsabilità
     * Collaborare con altri professionisti per determinare i requisiti funzionali e non funzionali per nuovi software o applicazioni;
     * Utilizzare strumenti e metodologie per creare rappresentazioni per le funzioni e l'interfaccia utente del prodotto desiderato;
     * Sviluppare specifiche di prodotto di alto livello con attenzione all'integrazione e alla fattibilità del sistema;
     * Definire tutti gli aspetti dello sviluppo: dalla tecnologia e dal flusso di lavoro appropriati agli standard di codifica;
     * Comunicare con successo tutti i concetti e le linee guida al team di sviluppo;
     * Supervisionare i progressi del team di sviluppo per garantire coerenza con la progettazione iniziale;
     * Fornire assistenza tecnica e coaching a sviluppatori e ingegneri;
     * Garantire che il software soddisfi tutti i requisiti di qualità, sicurezza, modificabilità, estensibilità;
     * Approvare il prodotto finale prima del lancio

1 Sviluppatore Full Stack

   La risorsa inserita si occuperà principalmente di:
   - sviluppare ed estendere applicazioni;
   - sviluppare servizi comuni di esecuzione;
   - collaborare col team nella definizione dell'architettura d'esecuzione;
   - ottimizzare le prestazioni dell'applicazione;
   - creare la documentazione tecnica del progetto.

TuoTempo è il software-as-a-service CRM sanitario in più rapida crescita in Europa, specializzato nella digitalizzazione degli operatori sanitari ridisegnando l'esperienza del paziente. La nostra tecnologia innovativa è la scelta preferita dai maggiori fornitori di servizi sanitari in Spagna, Italia e altri mercati. Stiamo ora cercando di espanderci con nuovi membri del team per rivoluzionare l'assistenza sanitaria! Se cercate maggiori informazioni visitate il nostro sito web http://www.tuotempo.com.

   Cerchiamo un professionista informatico che desidera lavorare in una azienda agile e informale dove avere la possibilità di contribuire alla evoluzione di una piattaforma di servizi per la sanità., * puoi far parte di una azienda giovane in forte crescita;
     * Il potenziale di crescita professionale e di ruolo è molto alto
     * siamo unazienda fondata sul lavoro remoto quindi puoi lavorare principalmente da casa, se ti piace stare in ufficio con noi sei il benvenuto;
     * usi le più moderne metodologie di lavoro (Agile, Scrum, MVP) e gli strumenti di collaborazione più innovativi (Slack, Trello, Gitlab, Slite, etc.);
     * espandi le tue competenze nelle tecnologie web confrontandoti con sfide complesse e sempre nuove (PHP 7.3, ELK, Redis, AWS, Symfony, MySQL Galera, Gearman, Nginx, etc...);
     * hai la possibilità di imparare/migliorare lingue straniere lavorando a progetti internazionali., * Problem Checking and Bug Fixing
     * Partecipare allevoluzione e rifattorizzazione del Core della piattaforma;
     * Proporre nuove soluzioni basate sulle tecnologie più recenti
     * Progettare, implementare e supportare i sistemi di sviluppo, ottimizzazione, test e monitoraggio di nuove funzionalità dellapplicazione.

La risorsa si occuperà principalmente di definire ed applicare le migliori pratiche di analisi, progettazione, sviluppo e manutenzione di progetti informatici basati su tecnologie enterprise e delle relative architetture software., * Definire i piani di attuazione dei progetti e le soluzioni tecnologiche per la realizzazione degli stessi;
   * Contribuire all'innovazione dei software e delle metodologie di implementazione, rendendo più efficace, flessibile ed efficiente il contesto attuale sia da un punto di vista tecnologico che economico;
   * Possedere la competenza tecnica nell'ambito della progettazione e dell'implementazione delle architetture software, in tutte le fasi, nel rispetto del ciclo di sviluppo sicuro del software;
   * Gestire l`intero ciclo di vita dell`architettura software, recependo il cambiamento dei requisiti di business e definendo una soluzione tecnica dettagliata;
   * Redigere i documenti previsti dai Sistemi di Gestione della Qualità e della Sicurezza aziendali e relativi al ciclo di vita dei progetti software, compresa la stesura di Capitolati Tecnici di Gara nel rispetto del codice degli Appalti Pubblici e delle linee guida dell'Agenzia per l'Italia Digitale, in merito a forniture di infrastrutture e servizi connessi in ambito ICT;
   * Garantire il presidio operativo in fase di conduzione dei sistemi realizzati., Manpower è una compagnia eticamente responsabile. Il servizio è gratuito. I candidati ambosessi (L.903/77 - D.Lgs. n.198/2006) sono invitati a leggere l'informativa Privacy su www.manpower.it Aut. Min. Prot. N. 1116 - SG - del 26/11/04.
