* UNIMAC-GHERRI, focalizzata in linee di confezionamento per prodotti alimentari in contenitori con capsule twist-off;
     * TIRELLI, specialista in macchine per la cosmetica;
     * MACA ENGINEERING, specializzata nella costruzione e fornitura di macchine e linee automatiche per la produzione e l'assemblaggio di capsule e chiusure in alluminio e plastica., AROL Group ha recentemente avviato un importante progetto di trasformazione digitale e, al fine di potenziare il proprio reparto ICT, ricerca un Sistemista IT per la gestione e l'ottimizzazione dell'infrastruttura informatica di Gruppo ed in particolare per supportare le sedi estere.

   L'attività sarà svolta principalmente presso le sedi italiane del gruppo, ma con frequenti trasferte presso le sedi estere: USA, Brasile, Messico, Cina, Francia, Germania., Dopo un primo periodo di formazione presso l'HQ di Canelli, il candidato diventerà il punto di riferimento per le sedi estere e per le quali dovrà effettuare un monitoraggio continuo del buon funzionamento dell'infrastruttura e fornire un primo livello di supporto in caso di necessità.

Le risorse saranno inserite nell'Area IT di un'Azienda strutturata che opera a livello nazionale nel settore della consulenza e si occuperanno in particolare di:
   Definire e analizzare aspetti tecnici su nuovi progetti e su implementazioni in progetti esistenti, con l'ottica di ottenere applicazioni performanti e mantenibili;
   Integrare servizi esterni al sito come CRM, tramite API;
   Relazionarsi con i colleghi durante le varie fasi del progetto e per l'assistenza continuativa su siti e web app esistenti;
   Presidiare i siti esistenti e gestirne il mantenimento e gli aggiornamenti;
   Gestire le emergenze dovute a bug e malfunzionamenti;
   Ricercare nuove tecnologie e approcci emergenti insieme ai Colleghi

Per la nostra sede di Marostica (VI) selezioniamo una risorsa Web Developer Magento che contribuirà allo sviluppo di applicazioni web., * sviluppare, implementare e integrare applicativi web;
     * realizzare le attività di manutenzione e di rilascio in produzione;
     * redigere i documenti di analisi tecnica di dettaglio;
     * eseguire attività di simulazione, testing e debugging al fine di garantire tutte le funzionalità.

La risorsa selezionata di occuperà di:
   - Progettazione di software per ambiente Windows;
   - Sviluppo software in ambiente .NET

* Rileva e interpreta le esigenze e i bisogni dell'utente e tradurli in requisiti del prodotto da realizzare;
   * Identifica le metodologie per gestire i processi di esecuzione e controllo dell'infrastruttura informatica e formalizzare i programmi dei moduli software;
   * Scrive in codice di programmazione quanto riportato sul progetto aziendale garantendo la coerenza nelle specifiche del sistema;
   * Individua e adotta piani di test e collaudo di conformità delle specifiche di progetto per la messa in esercizio del software;
   * Controlla l'integrazione dei componenti installati garantendo il corretto funzionamento del sistema e verificare la fattibilità di eventuali ulteriori interventi di assistenza e manutenzione sulla base delle indicazioni riportate nella documentazione tecnica;
   * Interviene nella risoluzione dei problemi operativi tecnico-informatici apportando modifiche o migliorie alle soluzioni esistenti ed erogando assistenza tecnica agli utenti delle applicazioni.

Partecipare attivamente al disegno e sviluppo delle soluzioni di integrazione per la realizzazione di progetti di digital transformation;
