Nell'ottica di un potenziamento dell'Organico, la Società è alla ricerca di una figura di SISTEMISTA NETWORK per la sede di Roma.

   La risorsa verrà inserita all'interno di un team di figure specializzate su ambiti diversi con l'obiettivo di disegnare, sviluppare e realizzare progetti complessi.

   Nello specifico la risorsa selezionata si occuperà della:
   - Definizione delle soluzioni architetturali di rete e di sicurezza;
   - Amministrazione avanzata di sistemi di rete;
   - Configurazione SWITCH, ROUTER, FIREWALL;
   - Supporto avanzato alla diagnosi di problematiche in ambito networking.

La risorsa, nel corso dello STAGE, sarà inserita all'interno del team tecnico dedicato all'assistenza clienti e si occuperà di:
   * attività di helpdesk in ambito sistemistico e assistenza tecnica al cliente finale;
   * preparazione, configurazione e installazione software di base su PC e Server;
   * installazione, configurazione e manutenzione di pc e periferiche collegate;
